import React, { Fragment } from 'react';

const Post = (props) => {
    <div className="post">
        <div className="img-thumb">
            <img src="http://placeimg.com/200/150/tech/grayscale" alt="dumm" />
        </div>
        <div className="content">
            <p className="title">{props.title}</p>
            <p className="desc">{props.desc}</p>
        </div>
    </div>
}

export default Post;
